  `bazt` varchar(1) NOT NULL COMMENT '备案状态 0:备案待受理 1:已备案 2:变更待受理 3:已变更 4:停业待受理 5:已停业 6:备案审核不通过 7:变更审核不通过 8:停业审核不通过',
  `czbz` char(1) NOT NULL COMMENT '操作标志',
