-- ----------------------------
-- Table structure for report_logs
-- ----------------------------
DROP TABLE IF EXISTS `report_logs`;
CREATE TABLE `report_logs` (
  `id` varchar(20) NOT NULL COMMENT '主键ID',
  `api_code` varchar(4) NOT NULL COMMENT '接口编号',
  `data_id` varchar(100) NOT NULL COMMENT '数据ID',
  `czbz` char(1) NOT NULL COMMENT '操作标志',
  `begin_time` datetime NOT NULL COMMENT '上报开始时间',
  `end_time` datetime NOT NULL COMMENT '上报结束时间',
  `time_consuming` int NOT NULL COMMENT '上报总耗时(毫秒)',
  `param` json DEFAULT NULL COMMENT '上报参数',
  `result` json DEFAULT NULL COMMENT '响应参数',
  `state` tinyint(1) NOT NULL COMMENT '上报状态 1成功 0失败',
  `handle_state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '处理状态 1已处理 0未处理',
  `delivery` tinyint(1) NOT NULL DEFAULT '0' COMMENT '重报投递：1已投递 0未投递',
  `region_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '行政区域ID',
  `country_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '国ID',
  `province_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '省ID',
  `city_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '市ID',
  `area_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '区ID',
  `enterprise_id` varchar(18) NOT NULL DEFAULT '-1' COMMENT '企业ID',
  `stock_house_id` varchar(21) NOT NULL DEFAULT '-1' COMMENT '库区ID',
  PRIMARY KEY (`id`,`api_code`) USING BTREE,
  KEY `idx_api_id` (`api_code`,`data_id`) USING BTREE COMMENT '接口编号和数据ID组合普通索引',
  KEY `idx_begin_time` (`begin_time`) USING BTREE COMMENT '请求开始时间普通索引',
  KEY `idx_end_time` (`end_time`) USING BTREE COMMENT '请求结束时间普通索引',
  KEY `idx_time_consuming` (`time_consuming`) USING BTREE COMMENT '请求总耗时普通索引',
  KEY `idx_state` (`state`) USING BTREE COMMENT '请求状态普通索引',
  KEY `idx_handle_state` (`handle_state`) USING BTREE COMMENT '处理状态普通索引',
  KEY `idx_delivery` (`delivery`) USING BTREE COMMENT '重报投递普通索引',
  KEY `idx_region_id` (`region_id`) USING BTREE COMMENT '行政区域ID普通索引',
  KEY `idx_enterprise_id` (`enterprise_id`,`stock_house_id`) USING BTREE COMMENT '企业ID/库区ID组合普通索引',
  KEY `idx_region_ids` (`country_id`,`province_id`,`city_id`,`area_id`) USING BTREE COMMENT '国/省/市/区组合普通索引'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='数据上报-上报日志表';

-- ----------------------------
-- Records of report_logs
-- ----------------------------

