-- ----------------------------
-- Table structure for trade_contract
-- ----------------------------
DROP TABLE IF EXISTS `trade_contract`;
CREATE TABLE `trade_contract` (
  `id` varchar(64) NOT NULL COMMENT '主键id',
  `hth` varchar(64) NOT NULL COMMENT '合同编号',
  `htmc` varchar(128) NOT NULL COMMENT '合同名称',
  `dwdm` varchar(18) NOT NULL COMMENT '单位代码',
  `ywlx` varchar(1) NOT NULL COMMENT '业务类型',
  `khlx` varchar(1) NOT NULL COMMENT '客户类型',
  `khtyshxydm` varchar(18) DEFAULT NULL COMMENT '客户统一社会信用代码',
  `khmc` varchar(256) NOT NULL COMMENT '客户名称',
  `fddbr` varchar(64) DEFAULT NULL COMMENT '法定代表人',
  `txdz` varchar(512) DEFAULT NULL COMMENT '通讯地址',
  `yzbm` varchar(6) DEFAULT NULL COMMENT '邮政编码',
  `lxrxm` varchar(64) DEFAULT NULL COMMENT '联系人姓名',
  `lxrdh` varchar(20) DEFAULT NULL COMMENT '联系人电话',
  `sfzh` varchar(18) DEFAULT NULL COMMENT '身份证号',
  `dzyx` varchar(64) DEFAULT NULL COMMENT '电子邮箱',
  `qdrq` date NOT NULL COMMENT '签订日期',
  `ydwcsj` date DEFAULT NULL COMMENT '约定完成时间',
  `qddd` varchar(512) DEFAULT NULL COMMENT '签订地点',
  `lspzdm` varchar(7) NOT NULL COMMENT '粮食品种代码',
  `lsxzdm` varchar(3) NOT NULL COMMENT '粮食性质代码',
  `htdj` decimal(20,6) NOT NULL COMMENT '合同单价',
  `ydgxlssl` decimal(20,6) NOT NULL COMMENT '约定购销粮食数量',
  `htzje` decimal(20,6) NOT NULL COMMENT '合同总金额',
  `lybzj` decimal(20,6) DEFAULT NULL COMMENT '履约保证金',
  `sswcsj` date DEFAULT NULL COMMENT '实际完成时间',
  `lysl` decimal(20,6) DEFAULT NULL COMMENT '履约数量',
  `lyl` decimal(20,6) DEFAULT NULL COMMENT '履约率',
  `jsjg` decimal(20,6) DEFAULT NULL COMMENT '结算价格',
  `jszje` decimal(20,6) DEFAULT NULL COMMENT '结算总金额',
  `jsyhtbyzyy` varchar(512) DEFAULT NULL COMMENT '结算与合同不一致原因',
  `jsyhtyzx` varchar(1) DEFAULT NULL COMMENT '结算与合同一致性',
  `khfkhh` varchar(3) DEFAULT NULL COMMENT '客户方开户行',
  `khfzh` varchar(30) DEFAULT NULL COMMENT '客户方账号',
  `khfqyr` varchar(64) DEFAULT NULL COMMENT '客户方签约人',
  `bfkhh` varchar(3) NOT NULL COMMENT '本方开户行',
  `bfzh` varchar(30) NOT NULL COMMENT '本方账号',
  `bfqyr` varchar(64) DEFAULT NULL COMMENT '本方签约人',
  `spr` varchar(64) DEFAULT NULL COMMENT '审核人',
  `shsj` datetime DEFAULT NULL COMMENT '审核时间',
  `wcrq` date DEFAULT NULL COMMENT '完成日期',
  `czbz` varchar(1) DEFAULT NULL COMMENT '操作标志',
  `zhgxsj` datetime NOT NULL COMMENT '最后更新时间',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '修改人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `region_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '行政区域ID',
  `country_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '国ID',
  `province_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '省ID',
  `city_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '市ID',
  `area_id` varchar(10) NOT NULL DEFAULT '-1' COMMENT '区ID',
  `enterprise_id` varchar(18) NOT NULL DEFAULT '-1' COMMENT '企业ID',
  `stock_house_id` varchar(21) NOT NULL DEFAULT '-1' COMMENT '库区ID',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `unx_hth` (`hth`) USING BTREE COMMENT '合同号唯一索引',
  KEY `idx_region_id` (`region_id`) USING BTREE COMMENT '行政区域ID普通索引',
  KEY `idx_region_ids` (`country_id`,`province_id`,`city_id`,`area_id`) USING BTREE COMMENT '行政地区组合索引',
  KEY `idx_qdrq` (`qdrq`) USING BTREE COMMENT '签订日期普通索引',
  KEY `idx_htmc` (`htmc`) USING BTREE COMMENT '合同名称普通索引',
  KEY `idx_enterprise` (`enterprise_id`,`stock_house_id`) USING BTREE COMMENT '企业ID/库区ID组合普通索引'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='合同信息表';

