  `cddm` varchar(6) NOT NULL COMMENT '产地代码',
  `pz` decimal(20,6) NOT NULL COMMENT '皮重（公斤）',
  `pzjby` varchar(64) DEFAULT NULL COMMENT '皮重监磅员',
  `pzjlsj` datetime NOT NULL COMMENT '皮重计量时间:格式：yyyy-MM-dd HH:mm :ss',
  `pzjly` varchar(64) DEFAULT NULL COMMENT '皮重计量员',
  `mz` decimal(20,6) NOT NULL COMMENT '毛重(公斤)',
  `mzjby` varchar(64) DEFAULT NULL COMMENT '毛重监磅员',
  `mzjlsj` datetime NOT NULL COMMENT '毛重计量时间：格式：yyyy-MM-dd HH:mm :ss',
  `mzjly` varchar(64) DEFAULT NULL COMMENT '毛重计量员',
  `bzw` varchar(1) DEFAULT NULL COMMENT '包装物：1：麻袋 2：编织袋 3：散装 9：其他',
  `bzbdbz` decimal(20,6) DEFAULT NULL COMMENT '标准包单包重',
  `bzbjs` int DEFAULT NULL COMMENT '标准包件数(件)',
  `jz` decimal(20,6) NOT NULL COMMENT '净重',
  `kzl` decimal(20,6) DEFAULT NULL COMMENT '扣 (增) 量',
  `zcbgyxm` varchar(256) DEFAULT NULL COMMENT '值仓保管员姓 名',
  `zxzydw` varchar(256) DEFAULT NULL COMMENT '装卸作业单位',
  `cmsj` datetime NOT NULL COMMENT '出门时间:格式：yyyy-MM-dd HH:mm :ss',
  `cmqrmgryxm` varchar(64) DEFAULT NULL COMMENT '出门确认门岗 人员姓名',
  `ckjsdh` varchar(33) DEFAULT NULL COMMENT '出库结算单号',
  `bz` varchar(400) DEFAULT NULL COMMENT '备注',
  `czbz` varchar(1) NOT NULL COMMENT '操作标志:i:新增数据 (默认) u:更新数据    d:删除数据',
  `zhgxsj` datetime NOT NULL COMMENT '最后更新时间',
