  `hwzt` varchar(1) NOT NULL COMMENT '货位（油罐）状态1：空仓，2：入库中，3：封仓，4：出库中，9：其他',
  `rcsj` datetime NOT NULL COMMENT '入仓时间',
  `fcrq` date DEFAULT NULL COMMENT '封仓日期',
